import React, { Component} from 'react';
import $ from 'jquery';
import data from "../data"; 

class Api extends Component{
	componentDidMount() {}
	
	render(){
		return (
			 <div className="row mb-4">
			 {
			 	data.ApiList.map((applist, i) => {
				return (
					<div key={i}className="col-sm-6 py-2 col-lg-4">
						<div key={i}class="card h-100">
						<div key={i}class="card-body">
						<h5 key={i}class="card-title"><i class={applist.icon}></i> {applist.title}</h5>
						<p key={i} class="card-text">{applist.descriptions}</p>
					</div>
					<div class="card-detail mx-3 "> 
						<ul class = "list-inline ">
							<li><a key={i} href={applist.link} class="text-dark no-underline text-capitalize footer-link-icon">Intro <span class="position-relative"><i class="fa fa-chevron-right float-right" ></i></span></a></li>
							<hr/>
							<li><a  key={i} href={applist.link} class="text-dark no-underline text-capitalize">Developer's guide <span class="position-relative"><i class="fa fa-chevron-right float-right"></i></span></a></li>
							<hr/>
							<li><a  key={i} href={applist.link} class="text-dark no-underline text-capitalize"> API reference<span class="position-relative"><i class="fa fa-chevron-right float-right"></i></span></a></li>
						</ul>
					</div>
					</div>
					</div>
					);
				})
			}
			 </div>
		);
    }
}
export default Api;
